   "source": [
    "There are a few problems we need to fix:\n",
    "1. The data can only be aggregated at the ride-level, which is too granular. We need to split the date-time data into -- **month_year**, **day_of_week**, **start_hour** -- that provide additional opportunities to aggregate the data.\n",
    "2. There are some rides where the **ride_length** shows up as negative or considered as an outliers. Negative or outliers **ride_length** maybe are caused by error in station timestamp system. We want to delete these data. \n",
    "3. There are some bike station (**start_station_name** or **end_station_name**) that are used for maintenance/repair/testing of the Divvy bikes. We want to delete these data."
   ]
  },
