   },
   "outputs": [],
   "source": [
    "member <- trip_data_no_dups[trip_data_no_dups$member_casual == \"member\",]\n",
    "casual <- trip_data_no_dups[trip_data_no_dups$member_casual == \"casual\",]\n",
    "\n",
    "# 25th and 75th percentile of dataset\n",
    "Q_member <- quantile(member$ride_length, probs = c(.25, .75), na.rm = FALSE)\n",
    "Q_casual <- quantile(casual$ride_length, probs = c(.25, .75), na.rm = FALSE)\n",
    "\n",
    "# iqr as the difference between 75th and 25th percentiles\n",
    "iqr_member <- IQR(member$ride_length)\n",
    "iqr_casual <- IQR(casual$ride_length)\n",
    "\n",
    "#cutoff range\n",
    "up_member <- Q_member[2] + 1.5*iqr_member #Q3 + 1.5*IQR\n",
    "low_member <- Q_member[1] - 1.5*iqr_member #Q1 - 1.5*IQR\n",
    "up_casual <- Q_casual[2] + 1.5*iqr_casual #Q3 + 1.5*IQR\n",
    "low_casual <- Q_casual[1] - 1.5*iqr_casual #Q1 - 1.5*IQR"
   ]
  },
