    "# remove negative ride_length and station names\n",
    "remove_station <- c('Base - 2132 W Hubbard Warehouse','HUBBARD ST BIKE CHECKING (LBS-WH-TEST)','WATSON TESTING - DIVVY','WEST CHI-WATSON','WEST CHI-WATSON','DIVVY CASSETTE REPAIR MOBILE STATION')\n",
    "trip_data_clean <- trip_data_no_dups %>% filter(!((start_station_name %in% remove_station) | (end_station_name %in% remove_station) | ride_length<=0))\n",
    "\n",
    "# remove outliers\n",
    "trip_data_clean_no_outliers <- trip_data_clean %>% filter(ifelse(member_casual == \"member\",ride_length > low_member & ride_length < up_member,ride_length > low_casual & ride_length < up_casual))\n",
    "\n",
    "print(paste(\"Removed\",nrow(trip_data_no_dups)-nrow(trip_data_clean_no_outliers),\"bad data\"))"
   ]
