   "source": [
    "#Average duration\n",
    "trip_data_clean_no_outliers %>% group_by(member_casual) %>% summarise(number_of_rides = n(), \"%\" = (n()/nrow(trip_data_clean))*100, average_duration = mean(ride_length)) %>% ggplot(aes(x = member_casual, y = average_duration, fill = member_casual)) + geom_col() + labs(x = element_blank(), y = \"Average Duration (mins)\")"
   ]
  },
