   "source": [
    "trip_data_clean_no_outliers %>% mutate(type_of_weekday = ifelse(day_of_week == \"Sat\" | day_of_week == \"Sun\", \"Weekend\", \"Midweek\")) %>% group_by(start_hour, member_casual, type_of_weekday) %>% summarise(average_number_of_rides = ifelse(type_of_weekday == \"Weekend\", n()/2, n()/5), average_duration = mean(ride_length)) %>% ggplot(aes(x = start_hour, y = average_number_of_rides, fill = member_casual)) + geom_col(position = \"dodge\") + facet_wrap(~ type_of_weekday)"
   ]
